<script lang="ts">
	import { onMount } from 'svelte';

	import Parallax from 'parallax-js';
	// import ParallaxSvg from "../../assets/ParallaxSvg.svelte";

	let parallaxSvg;

	let separationMultip = 0.025; // higher = more separation
	let frictionMultip = 0.75; // higher = more friction in lower layers

	onMount( async () => {

		// parallaxSvg.querySelector('g').remove();

		let groups = parallaxSvg.querySelectorAll('g');
		let arrayNodes = [...groups];
		arrayNodes.reverse();
		arrayNodes.forEach( (el, i, a) => {

			let index_inv = a.length - (i+1);
			let upDownIndex = i < (a.length / 2) ? index_inv : i;
			let offset = (a.length - 1) / 2;

			el.setAttribute('data-depth', ( (i - offset) * separationMultip ) );

			// let rampFunction = 1 / ((i * frictionMultip) + 1); // ramp up
			// let rampFunction = 1 / ((index_inv * frictionMultip) + 1); // ramp down
			let rampFunction =  1 / ( Math.pow( Math.sqrt( Math.pow( (( (a.length - 1) / 2 ) - i) , 2) ), frictionMultip) + 1 ); // ramp up - down

			// console.log(rampFunction);
			el.setAttribute('data-friction', rampFunction);
		});


		// if (isDesktop) {
			let parallaxInstance = new Parallax(parallaxSvg);
			parallaxInstance.friction(0.1, 0.1);
			// parallaxInstance.scalar(20, 20);
		// }
	} );
</script>



